import React, { Component } from 'react'

export default class LeftContent extends Component {
 
  tabRow =(news)=>{
      news.map((newz,i)=>{
          return <TableRowContent key={i} newz={newz} index={i}/>
      }) 
  }
  render() {
    return (
        <div class="col-12 col-lg-6">
        <div class="single-blog-post style-3">
            <div class="post-thumb">
                <a href="#"><img src="img/bg-img/7.jpg" alt="" /></a>
            </div>                              <div class="post-data">
                <a href="#" class="post-catagory">Finance</a>
                <a href="#" class="post-title">
                    <h6>This Is How Notebooks Of An Artist Who Travels Around The World Look
                    
                    </h6>
                </a>
                <div class="post-meta">
                    <p class="post-author">By <a href="#">Michael Smithson</a></p>
                    <p class="post-date">5 Hours Ago</p>
                </div>
            </div>
        </div>
    </div>
    )
  }
}
